	<p>Flare Dating —è –±–∞—á–∏–≤ —Å–æ—Ü—ñ–∞–ª—å–Ω—ñ –º–µ—Ä–µ–∂—ñ –¥–µ –ª—é–¥–∏ –º–æ–∂—É—Ç—å –∑—É—Å—Ç—Ä—ñ—Ç–∏—Å—å –æ–Ω–ª–∞–π–Ω –∑–∞ –∑–Ω–∞–π–æ–º—Å—Ç–≤, –¥—Ä—É–∂–±–∞, —á–∞—Ç —ñ –±—ñ–ª—å—à–µ. –î–õ–Ø –ö–û–ì–û: FlareDating –Ω–µ —Ç—ñ–ª—å–∫–∏ –¥–æ—Å—Ç—É–ø–Ω–∏–π –¥–ª—è —á–æ–ª–æ–≤—ñ–∫—ñ–≤ —ñ –∂—ñ–Ω–æ–∫ —É –º–æ–ª–æ–¥–æ–º—É —Ç–∞ –ø–æ—Ö–∏–ª–æ–º—É –≤—ñ—Ü—ñ –∞–ª–µ —ñ –¥–ª—è –±—ñ—Å–µ–∫—Å—É–∞–ª—ñ–≤ —á–æ–ª–æ–≤—ñ–∫—ñ–≤ —ñ –∂—ñ–Ω–æ–∫, –ª–µ—Å–±—ñ—è–Ω–æ–∫ —á–∏ –≥–µ—ó–≤. –¢–∞–∫–æ–∂ –¥–æ—Å—Ç—É–ø–Ω—ñ —Ç–∞–∫—ñ –≤–∞—Ä—ñ–∞–Ω—Ç–∏, —è–∫ –∑–Ω–∞–π—Ç–∏ –ø–∞—Ä—Ç–Ω–µ—Ä–∞ –¥–ª—è –ø–æ–¥–æ—Ä–æ–∂–µ–π –∞–±–æ —Å–ø–æ—Ä—Ç–∏–≤–Ω–æ–≥–æ –ø–∞—Ä—Ç–Ω–µ—Ä–∞ —É –≤–∞—à–æ–º—É —Ä–µ–≥—ñ–æ–Ω—ñ.</p>
<p>–û—Å—Ç–∞–Ω–Ω—ñ —Ç–µ–Ω–¥–µ–Ω—Ü—ñ—ó - —Ü–µ –ª—é–¥–∏, —è–∫—ñ —à—É–∫–∞—é—Ç—å –ª–∏—à–µ LAT –≤—ñ–¥–Ω–æ—Å–∏–Ω, –¥–µ –≤–∏ –æ–±–∏—Ä–∞—î—Ç–µ –º–æ–Ω–æ–≥–∞–º–Ω—ñ —Å—Ç–æ—Å—É–Ω–∫–∏ —ñ —â–µ –Ω–µ –∂–∏–≤–µ—Ç–µ —Ä–∞–∑–æ–º. –ó –ø–æ—è–≤–æ—é –Ü–Ω—Ç–µ—Ä–Ω–µ—Ç—É —Å–≤—ñ—Ç, –∑–¥–∞—î—Ç—å—Å—è, –Ω–∞–±–∞–≥–∞—Ç–æ –º–µ–Ω—à–µ. –î–ª—è —Ü—å–æ–≥–æ –ª–µ–≥–∫–æ –∑–Ω–∞–π—Ç–∏ –æ–¥–Ω–æ–≥–æ —ñ–Ω–æ–∑–µ–º–Ω–æ–≥–æ –ø–∞—Ä—Ç–Ω–µ—Ä–∞. –ù–µ –≤—Å—ñ –º–∞—é—Ç—å –º—Ä—ñ—é –≤–∏–π—Ç–∏ –∑–∞–º—ñ–∂ —ñ —à—É–∫–∞—Ç–∏ –ø–∞—Ä—Ç–Ω–µ—Ä–∞, —â–æ–± –∂–∏—Ç–∏ —Ä–∞–∑–æ–º. –¶–µ –ø–æ–ø—É–ª—è—Ä–Ω–∞ —Ñ—É–Ω–∫—Ü—ñ—è, —â–æ–± –ª—é–¥–∏ –º–æ–≥–ª–∏ –∑–Ω–∞—Ç–∏, —Ö—Ç–æ –≤–∞–º –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è.</p>
<p>–ü–æ–≥–æ–≤–æ—Ä–∏—Ç–∏ –≤ 3D-–Ω–æ–º–µ—Ä–∞—Ö, –≤–∫–ª—é—á–∞—é—á–∏ "–í—É–ª–∏—á–Ω–∏–π —á–∞—Ç", —Ü–µ —Ö–æ—Ä–æ—à–∏–π –∂–∏—Ç—Ç—î–≤–∏–π –¥–æ—Å–≤—ñ–¥ –¥–ª—è –≤–∞—Å. –¢–∏ –º–æ–∂–µ—à –°—Ç–≤–æ—Ä—ñ—Ç—å –≤–ª–∞—Å–Ω–∏–π –∞–≤–∞—Ç–∞—Ä —ñ —Å–ø—ñ–ª–∫—É–π—Ç–µ—Å—è –∑ —ñ–Ω—à–∏–º–∏ —É—á–∞—Å–Ω–∏–∫–∞–º–∏ –≤ –Ü–Ω—Ç–µ—Ä–Ω–µ—Ç—ñ. –ß–∞—Å–æ–≤–∏–π –ø–æ—è—Å, –∑–∞ —è–∫–∏–º –≤–∏ –º–æ–∂–µ—Ç–µ —Å—Ç–µ–∂–∏—Ç–∏ –∑–∞ –¥—ñ—è–º–∏ –¥–æ–¥–∞–Ω–∏—Ö –¥—Ä—É–∑—ñ–≤. –ö–æ–ª–∏ –≤–æ–Ω–∏ –∑–∞–≤–∞–Ω—Ç–∞–∂–∏–ª–∏ —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ—ñ—é –∞–±–æ –≤—ñ–¥–µ–æ. –ê –Ω–µ–ø–æ–¥–∞–ª—ñ–∫ - –æ–¥–∏–Ω —ñ–∑ –Ω–∞–π–±—ñ–ª—å—à —Ü—ñ–∫–∞–≤–∏—Ö –æ–±'—î–∫—Ç—ñ–≤ –º—É–∑–µ—é - –ø—ñ–¥–∑–µ–º–Ω–∏–π –∫–æ–º–∞–Ω–¥–Ω–∏–π –ø—É–Ω–∫—Ç –ö–ü ¬ª, - –≥–æ–≤–æ—Ä–∏—Ç—å –õ—é–¥–º–∏–ª–∞ –¢–∞—Ä–∞—Å–µ–Ω–∫–æ.</p>
