	<p>–ö–æ–º–∞–Ω–¥–Ω–∏–π –ø—É–Ω–∫—Ç –º—ñ–≥ –Ω–∞–¥—ñ–π–Ω–æ —Ñ—É–Ω–∫—Ü—ñ–æ–Ω—É–≤–∞—Ç–∏ –≤ —Ä—ñ–∑–Ω–∏—Ö —É–º–æ–≤–∞—Ö, –∑–æ–∫—Ä–µ–º–∞ —ñ –≤ –∞–≤—Ç–æ–Ω–æ–º–Ω–æ–º—É —Ä–µ–∂–∏–º—ñ –ø—Ä–æ—Ç—è–≥–æ–º 45 –¥—ñ–±. –í–∞—Ä—Ç–æ –∑–∞—É–≤–∞–∂–∏—Ç–∏, —â–æ –¥—ñ—Ç—è–º –∫—Ä—ñ–º —Å—Ç–∞—Ä—à–æ–∫–ª–∞—Å–Ω–∏–∫—ñ–≤ –¥–æ–∑–≤–æ–ª—è—é—Ç—å –≤—ñ–¥–≤—ñ–¥—É–≤–∞—Ç–∏ –ø—ñ–¥–∑–µ–º–Ω–∏–π –ö–ü —Ç—ñ–ª—å–∫–∏ —É —Å—É–ø—Ä–æ–≤–æ–¥—ñ –¥–æ—Ä–æ—Å–ª–∏—Ö. –Ü —Ç–µ—Ö–Ω—ñ–∫–∞ –±–µ–∑–ø–µ–∫–∏ —Ç—É—Ç ‚Äî —è–∫ —É –≤—ñ–π—Å—å–∫—É, –∞ –Ω–µ —è–∫ –Ω–∞ —Ä–æ–∑–≤–∞–∂–∞–ª—å–Ω–æ–º—É –∞—Ç—Ä–∞–∫—Ü—ñ–æ–Ω—ñ. –ó–∞—Ç–µ –≤—ñ–¥—á—É—Ç—Ç—è –≤—ñ–¥ –ø–µ—Ä–µ–±—É–≤–∞–Ω–Ω—è —Ç—É—Ç –ø—Ä–æ—Å—Ç–æ –Ω–µ–π–º–æ–≤—ñ—Ä–Ω—ñ¬ª, - –∫–∞–∂–µ –¢–∞—Ä–∞—Å–µ–Ω–∫–æ. –í–æ–Ω–∞ —Å—Ç–≤–æ—Ä–µ–Ω–∞ –≤ —Å–µ—Ä–µ–¥–∏–Ω—ñ —Ö —Ä–æ–∫—ñ–≤ —É –ö–ë ¬´–ü—ñ–≤–¥–µ–Ω–Ω–µ¬ª. –¶—è —Ä–∞–∫–µ—Ç–∞ –∑–¥–∞—Ç–Ω–∞ –¥–æ—Å—Ç–∞–≤–∏—Ç–∏ –¥–µ—Å—è—Ç—å —è–¥–µ—Ä–Ω–∏—Ö –±–æ—î–≥–æ–ª–æ–≤–æ–∫ –∑ —ñ–Ω–¥–∏–≤—ñ–¥—É–∞–ª—å–Ω–∏–º –Ω–∞–≤–µ–¥–µ–Ω–Ω—è–º –ø–æ—Ç—É–∂–Ω—ñ—Å—Ç—é –ö—Ç –∫–æ–∂–Ω–∞ –Ω–∞ –≤—ñ–¥—Å—Ç–∞–Ω—å –≤ 15 —Ç–∏—Å—è—á –∫—ñ–ª–æ–º–µ—Ç—Ä—ñ–≤.</p>
<p>–ö—Ä—ñ–º —Ç–æ–≥–æ, –≤–æ–Ω–∞ –æ—Å–Ω–∞—â–µ–Ω–∞ –≤—ñ—Å—å–º–æ–º–∞ –≤–∞–∂–∫–∏–º–∏ –ø–æ–º–∏–ª–∫–æ–≤–∏–º–∏ —Ü—ñ–ª—è–º–∏, –∞–∫—Ç–∏–≤–Ω–∏–º–∏ –ø–æ—Å—Ç–∞–Ω–æ–≤–Ω–∏–∫–∞–º–∏ –ø–µ—Ä–µ—à–∫–æ–¥, –¥–∏–ø–æ–ª—å–Ω–∏–º–∏ –≤—ñ–¥–±–∏–≤–∞—á–∞–º–∏.</p><strong><a id='d2'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞</h2></strong><p>–á—ó –≥–æ—Ç–æ–≤–Ω—ñ—Å—Ç—å –¥–æ –∑–∞–ø—É—Å–∫—É —Å—Ç–∞–Ω–æ–≤–∏—Ç—å —É—Å—å–æ–≥–æ 62 —Å–µ–∫—É–Ω–¥–∏. –í–∑–∞–≥–∞–ª—ñ –≤—ñ–¥–≤—ñ–¥—É–≤–∞—á—ñ –º—É–∑–µ—é –º–∞—é—Ç—å –∑–º–æ–≥—É –æ—Ç—Ä–∏–º–∞—Ç–∏ –ø–æ–≤–Ω—É —É—è–≤—É –ø—Ä–æ —Ä–æ–∑–≤–∏—Ç–æ–∫ —Ä–∞–¥—è–Ω—Å—å–∫–∏—Ö –±–∞–ª—ñ—Å—Ç–∏—á–Ω–∏—Ö —Ä–∞–∫–µ—Ç. –ê–¥–∂–µ –ø—Ä–æ—Ç—è–≥–æ–º –º–∞–π–∂–µ –ø—ñ–≤—Å—Ç–æ–ª—ñ—Ç—Ç—è, –±—É–ª–∏ —Ä–æ–∑—Ä–æ–±–ª–µ–Ω—ñ, –≤–∏–ø—Ä–æ–±—É–≤–∞–Ω—ñ —ñ –ø—Ä–∏–π–Ω—è—Ç—ñ –Ω–∞ –æ–∑–±—Ä–æ—î–Ω–Ω—è –¥–µ—Å—è—Ç–∫–∏ —Ä—ñ–∑–Ω–∏—Ö —Ç–∏–ø—ñ–≤ —Ä–∞–∫–µ—Ç.</p>
		
