	<p>–á—ó –º–∞–∫–µ—Ç —Ç–∞–∫–æ–∂ –µ–∫—Å–ø–æ–Ω—É—î—Ç—å—Å—è —É –º—É–∑–µ—ó¬ª, - –Ω–∞–≥–∞–¥—É—é—Ç—å —Å–ø—ñ–≤—Ä–æ–±—ñ—Ç–Ω–∏–∫–∏ –º—É–∑–µ—é. –†–∞–∫–µ—Ç–∞ –† –±—É–ª–∞ –≥–æ–ª–æ–≤–Ω–∏–º —Ñ—ñ–≥—É—Ä–∞–Ω—Ç–æ–º ¬´–∫–∞—Ä–∏–±—Å—å–∫–æ—ó –∫—Ä–∏–∑–∏¬ª. –£ –∂–æ–≤—Ç–Ω—ñ —Ä–æ–∫—É –ø–∞—Ä—Ç—ñ—é —Ü–∏—Ö —Ä–∞–∫–µ—Ç –ø–µ—Ä–µ–∫–∏–Ω—É–ª–∏ –Ω–∞ –ö—É–±—É, —â–æ –ª–µ–¥—å –Ω–µ —Å–ø—Ä–æ–≤–æ–∫—É–≤–∞–ª–æ —è–¥–µ—Ä–Ω–∏–π –∫–æ–Ω—Ñ–ª—ñ–∫—Ç.</p><a id='d3'></a><h3>–ö—Ä–∞–∫—ñ–≤ - –õ—å–≤—ñ–≤</h3><p>–¶—ñ–∫–∞–≤–∞ –¥–µ—Ç–∞–ª—å: –ø–æ—Ä—è–¥ —ñ–∑ —Ç–µ—Ö–Ω—ñ—á–Ω–∏–º–∏ –Ω–æ–≤–æ–≤–≤–µ–¥–µ–Ω–Ω—è–º–∏ —ñ –ø–æ—Ç—É–∂–Ω–∏–º–∏ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∞–º–∏ –∞ –† –º–æ–≥–ª–∞ –Ω–µ—Å—Ç–∏ –∑–∞—Ä—è–¥ –≤ 2 –º–µ–≥–∞—Ç–æ–Ω–Ω–∏ , —Ü—è —Ä–∞–∫–µ—Ç–∞ –º–∞–ª–∞ —ñ –ø–µ–≤–Ω—ñ ¬´—Å–ø–∞–¥–∫–æ–≤—ñ¬ª —Ä–∏—Å–∏, –∑–æ–∫—Ä–µ–º–∞ —ó—ó –¥—ñ–∞–º–µ—Ç—Ä –±—É–≤ –∑–∞–ª–∏—à–µ–Ω–∏–π —â–µ –≤—ñ–¥ –Ω—ñ–º–µ—Ü—å–∫–æ—ó –§–ê–£ –ù–∞—Å—Ç—É–ø–Ω–∞ –º–æ–¥–µ–ª—å - –† - –¥–æ—Å—Ç–∞–≤–ª—è–ª–∞ —è–¥–µ—Ä–Ω–∏–π –∑–∞—Ä—è–¥ –≤–∂–µ –Ω–∞ 4,5 —Ç–∏—Å—è—á—ñ –∫–º. –£ –∫—ñ–Ω—Ü—ñ —Ä–æ–∫—É –Ω–∞ –æ–∑–±—Ä–æ—î–Ω–Ω—è –ø—Ä–∏–π–º–∞—î—Ç—å—Å—è –ø–µ—Ä—à–∞ –¥–≤–æ—Å—Ç—É–ø–µ–Ω–µ–≤–∞ —Ä–∞–∫–µ—Ç–∞ –† –í–æ–Ω–∞ –º–æ–≥–ª–∞ –¥–æ—Å—Ç–∞–≤–∏—Ç–∏ –±–æ—î–≥–æ–ª–æ–≤–∫—É –ø–æ—Ç—É–∂–Ω—ñ—Å—Ç—é 3 –º–µ–≥–∞—Ç–æ–Ω–Ω–∏ –Ω–∞ 13 —Ç–∏—Å—è—á –∫—ñ–ª–æ–º–µ—Ç—Ä—ñ–≤ - —Ü–µ –≤–∂–µ –º—ñ–∂–∫–æ–Ω—Ç–∏–Ω–µ–Ω—Ç–∞–ª—å–Ω–∞ —Ä–∞–∫–µ—Ç–∞.</p>
