	<p>–í—Å–µ —Ü–µ –¥—É–∂–µ —É—Å–∫–ª–∞–¥–Ω—é–≤–∞–ª–æ —ó—Ö –ø–µ—Ä–µ–±—É–≤–∞–Ω–Ω—è –Ω–∞ –±–æ–π–æ–≤–æ–º—É —á–µ—Ä–≥—É–≤–∞–Ω–Ω—ñ —ñ –∑–Ω–∏–∂—É–≤–∞–ª–æ –µ—Ñ–µ–∫—Ç–∏–≤–Ω—ñ—Å—Ç—å. –í–æ–Ω–∏ —Ç–∞–∫–æ–∂ –±—É–ª–∏ –Ω–∞ –æ–∑–±—Ä–æ—î–Ω–Ω—ñ —ó —Ä–∞–∫–µ—Ç–Ω–æ—ó –∞—Ä–º—ñ—ó. –ú—É–∑–µ–π –Ω–∞–º–∞–≥–∞—î—Ç—å—Å—è –ø–æ—Å—Ç—ñ–π–Ω–æ –ø–æ–ø–æ–≤–Ω—é–≤–∞—Ç–∏ —Å–≤–æ—é –µ–∫—Å–ø–æ–∑–∏—Ü—ñ—é. –í—ñ–Ω –ø—Ä–µ–¥—Å—Ç–∞–≤–ª—è—î —Å–æ–±–æ—é –∫–æ–ª–æ–Ω–Ω—É –≤–∞–Ω—Ç–∞–∂—ñ–≤–æ–∫, –Ω–∞ —è–∫–∏—Ö —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω–µ —Ä—ñ–∑–Ω–æ–º–∞–Ω—ñ—Ç–Ω–µ —Å–ø–µ—Ü—ñ–∞–ª—ñ–∑–æ–≤–∞–Ω–µ –æ–±–ª–∞–¥–Ω–∞–Ω–Ω—è¬ª, - —Ä–æ–∑–ø–æ–≤—ñ–¥–∞—î –ê. –°—é–¥–∏ –≤–≤—ñ–π—à–ª–∏ 7 —É–Ω—ñ–∫–∞–ª—å–Ω–∏—Ö –≤—ñ–π—Å—å–∫–æ–≤–∏—Ö –º–∞—à–∏–Ω.</p><strong><a id='d4'></a><h2>5 –º—ñ—Å—Ü—å, —ñ–∑ —è–∫–∏—Ö –≤–∞—Ä—Ç–æ —Ä–æ–∑–ø–æ—á–∞—Ç–∏ –∑–Ω–∞–π–æ–º—Å—Ç–≤–æ –∑ –ü–µ—Ä–≤–æ–º–∞–π—Å—å–∫–æ–º</h2></strong><p>–©–µ –æ–¥–Ω–µ –Ω–µ—â–æ–¥–∞–≤–Ω—î –Ω–∞–¥–±–∞–Ω–Ω—è –º—É–∑–µ—é ‚Äî –µ—à–µ–ª–æ–Ω –¥–ª—è —Ç—Ä–∞–Ω—Å–ø–æ—Ä—Ç—É–≤–∞–Ω–Ω—è –±–∞–ª—ñ—Å—Ç–∏—á–Ω–∏—Ö —Ä–∞–∫–µ—Ç. –î–ª—è —Ü—å–æ–≥–æ –Ω–∞ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ—ó –º—É–∑–µ—é –ø–æ–±—É–¥—É–≤–∞–ª–∏ –º–µ—Ç—Ä–∏ –∑–∞–ª—ñ–∑–Ω–∏—á–Ω–∏—Ö –∫–æ–ª—ñ–π. –ï—à–µ–ª–æ–Ω —É–∫–æ–º–ø–ª–µ–∫—Ç–æ–≤–∞–Ω–∏–π –º–∞–Ω–µ–≤—Ä–æ–≤–∏–º —Ç–µ–ø–ª–æ–≤–æ–∑–æ–º, –¥–≤–æ–º–∞ –ø–∞—Å–∞–∂–∏—Ä—Å—å–∫–∏–º–∏ –≤–∞–≥–æ–Ω–∞–º–∏ –¥–ª—è –æ—Å–æ–±–æ–≤–æ–≥–æ —Å–∫–ª–∞–¥—É, –≤–∞–≥–æ–Ω–æ–º —Å—É–ø—Ä–æ–≤–æ–¥—É —Ç–∞ —ñ–∑–æ—Ç–µ—Ä–º—ñ—á–Ω–∏–º–∏ —Ç—Ä–∞–Ω—Å–ø–æ—Ä—Ç–Ω–∏–º–∏ –≤–∞–≥–æ–Ω–∞–º–∏. –Ñ –π —ñ–Ω—à—ñ, –Ω–µ –º–µ–Ω—à —Ü—ñ–∫–∞–≤—ñ –µ–∫—Å–ø–æ–Ω–∞—Ç–∏. –¢–∞ —Å–∫—ñ–ª—å–∫–∏ –± –º–∏ –Ω–µ —Ä–æ–∑–ø–æ–≤—ñ–¥–∞–ª–∏ –ø—Ä–æ –µ–∫—Å–ø–æ–Ω–∞—Ç–∏ —Ü—å–æ–≥–æ –¥—ñ–π—Å–Ω–æ —É–Ω—ñ–∫–∞–ª—å–Ω–æ–≥–æ –º—É–∑–µ—é, —â–æ–± —Å–ø–æ–≤–Ω–∞ —ó—Ö –æ—Ü—ñ–Ω–∏—Ç–∏, —Ç—Ä–µ–±–∞ —Ç—É—Ç –ø–æ–±—É–≤–∞—Ç–∏.</p>
